; (function ($) {

    'use strict';

    $.fn.fitVids = function (options) {
        var settings = {
            customSelector: null,
            ignore: null
        };

        if (!document.getElementById('fit-vids-style')) {
            // appendStyles: https://github.com/toddmotto/fluidvids/blob/master/dist/fluidvids.js
            var head = document.head || document.getElementsByTagName('head')[0];
            var css = '.fluid-width-video-wrapper{width:100%;position:relative;padding:0;}.fluid-width-video-wrapper iframe,.fluid-width-video-wrapper object,.fluid-width-video-wrapper embed {position:absolute;top:0;left:0;width:100%;height:100%;}';
            var div = document.createElement("div");
            div.innerHTML = '<p>x</p><style id="fit-vids-style">' + css + '</style>';
            head.appendChild(div.childNodes[1]);
        }

        if (options) {
            $.extend(settings, options);
        }

        return this.each(function () {
            var selectors = [
                'iframe[src*="player.vimeo.com"]',
                'iframe[src*="youtube.com"]',
                'iframe[src*="youtube-nocookie.com"]',
                'iframe[src*="kickstarter.com"][src*="video.html"]',
                'object',
                'embed'
            ];

            if (settings.customSelector) {
                selectors.push(settings.customSelector);
            }

            var ignoreList = '.fitvidsignore';

            if (settings.ignore) {
                ignoreList = ignoreList + ', ' + settings.ignore;
            }

            var $allVideos = $(this).find(selectors.join(','));
            $allVideos = $allVideos.not('object object'); // SwfObj conflict patch
            $allVideos = $allVideos.not(ignoreList); // Disable FitVids on this video.

            $allVideos.each(function () {
                var $this = $(this);
                if ($this.parents(ignoreList).length > 0) {
                    return; // Disable FitVids on this video.
                }
                if (this.tagName.toLowerCase() === 'embed' && $this.parent('object').length || $this.parent('.fluid-width-video-wrapper').length) { return; }
                if ((!$this.css('height') && !$this.css('width')) && (isNaN($this.attr('height')) || isNaN($this.attr('width')))) {
                    $this.attr('height', 9);
                    $this.attr('width', 16);
                }
                var height = (this.tagName.toLowerCase() === 'object' || ($this.attr('height') && !isNaN(parseInt($this.attr('height'), 10)))) ? parseInt($this.attr('height'), 10) : $this.height(),
                    width = !isNaN(parseInt($this.attr('width'), 10)) ? parseInt($this.attr('width'), 10) : $this.width(),
                    aspectRatio = height / width;
                if (!$this.attr('name')) {
                    var videoName = 'fitvid' + $.fn.fitVids._count;
                    $this.attr('name', videoName);
                    $.fn.fitVids._count++;
                }
                $this.wrap('<div class="fluid-width-video-wrapper"></div>').parent('.fluid-width-video-wrapper').css('padding-top', (aspectRatio * 100) + '%');
                $this.removeAttr('height').removeAttr('width');
            });
        });
    };

    // Internal counter for unique video names.
    $.fn.fitVids._count = 0;

    // Works with either jQuery or Zepto
})(window.jQuery || window.Zepto);;
// Mobile nav
var Yapper = (function () {
    var $navElement = $('.js-nav');
    var $toggleButton = $('.js-toggleNav');
    var $body = $('.js-body');
    var $document = $(document);

    $toggleButton.click(function (e) {
        $navElement.toggleClass('is-open');
        $toggleButton.toggleClass('is-open');
        $body.toggleClass('is-locked');
        e.stopPropagation();
    });

    $document.click(function () {
        $navElement.removeClass('is-open');
        $toggleButton.removeClass('is-open');
        $body.removeClass('is-locked');
    });
})();

// Owl

$('.js-slider-worldrecords').owlCarousel({
    items: 1,
    loop: false,
    URLhashListener: true,
    autoplayHoverPause: true,
    startPosition: 'URLHash'
});

$('.js-slider-rankings').owlCarousel({
    items: 1,
    loop: false,
    URLhashListener: true,
    autoplayHoverPause: true,
    startPosition: 'URLHash'
});

// ScrollMagic
// create a scene with custom options and assign a handler to it.
var controller = new ScrollMagic.Controller();

$('.u-animation--fadeInSection').each(function () {
    new ScrollMagic.Scene({
        triggerElement: this,
        reverse: false
    })
        .setClassToggle(this, 'u-animation--fadeInWithMove')
        .adDto(controller);
});

// Header parallax
var top_header = $('.js-siteHeader');
$(window).scroll(function () {
    var st = $(this).scrollTop();
    top_header.css({ 'background-position': 'center calc(50% + ' + (st * .5) + 'px)' });
});

$('.js-select2-athletes').select2({
    ajax: {
        url: "/Events/SearchAthletes",
        dataType: 'json',
        delay: 250,
        data: function (params) {
            return {
                searchTerm: params.term,
                pageNum: params.page || 1,
            };
        },
        processResults: function (data, params) {
            params.page = params.page || 1;

            return {
                results: $.map(data.UserList, function (obj) {
                    return { id: obj.Id, text: obj.DisplayName };
                }),
                pagination: {
                    more: (params.page * 25) < data.UserListCount
                }
            };
        }
    },
    allowClear: true,
    minimumInputLength: 0,
    placeholder: "Select athletes"
});

$('.js-select2-country').select2();

// Fitvids
$('.js-fitvideo').fitVids();

// Toggle active classes
$('.js-recordsTitle').click(function () {
    $('.js-recordsTitle').removeClass('is-active');
    $(this).toggleClass('is-active')
});

$('.js-rankingsTitle').click(function () {
    $('.js-rankingsTitle').removeClass('is-active');
    $(this).toggleClass('is-active')
});;